import React from "react";
import UserInput from "./UserInput";

class UserOutput extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="output">
        {this.props.text}
        <div>{this.props.text.length}</div>
      </div>
    );
  }
}

export default UserOutput;
